using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class InsulationInputModel : Notifier	{		public InsulationInputModel()		{					ShellInsulationRequired = "";			ShellInsulationThickness = "";			RoofInsulationRequired = "";			RoofInsulationThickness = "";		}				private string _ShellInsulationRequired;		public string ShellInsulationRequired			{				get { return _ShellInsulationRequired; }				set				{					_ShellInsulationRequired = value;					OnPropertyChanged(nameof(ShellInsulationRequired));				}			}				private string _ShellInsulationThickness;		public string ShellInsulationThickness			{				get { return _ShellInsulationThickness; }				set				{					_ShellInsulationThickness = value;					OnPropertyChanged(nameof(ShellInsulationThickness));				}			}				private string _RoofInsulationRequired;		public string RoofInsulationRequired			{				get { return _RoofInsulationRequired; }				set				{					_RoofInsulationRequired = value;					OnPropertyChanged(nameof(RoofInsulationRequired));				}			}				private string _RoofInsulationThickness;		public string RoofInsulationThickness			{				get { return _RoofInsulationThickness; }				set				{					_RoofInsulationThickness = value;					OnPropertyChanged(nameof(RoofInsulationThickness));				}			}			}}